import React, { Component } from 'react';
import logo from './images/jamiedesignedfinal.svg';
import Portfolio from './components/Portfolio';
import AddTripButton from './components/test';
import Button from './components/Button';
import './styles/App.css';
import './styles/portfolio.css';

class App extends Component {

    constructor(props) {
    super(props)
    this.state = { isEmptyState: true }
  }

  triggerAddTripState = () => {
    this.setState({
      ...this.state,
      isEmptyState: false,
      isAddTripState: true
    })
  }

  render() {

    return (
      <div className="App">
        <header className="App-header section-padding">

            {this.state.isAddTripState && <img src={logo} className="App-logo" alt="logo" /> }
        </header>

           {this.state.isAddTripState && <Portfolio />}

        <footer>
           <div className="cities section-padding">
               <ruby>Tokyo <rp>(</rp><rt>トーキョー</rt><rp>)</rp></ruby>
             <h4>・</h4>
              <ruby>Dubai <rp>(</rp><rt>ドゥーバイ</rt><rp>)</rp></ruby>
             <h4>・</h4>
              <ruby>Warwick <rp>(</rp><rt>ウォリック</rt><rp>)</rp></ruby>
          </div>

            <div>
      {this.state.isEmptyState && <AddTripButton addTrip={this.triggerAddTripState} />}

    </div>

            <Button />



        </footer>
      </div>
    );
  }

}

export default App;
